import React, { Component } from 'react'

export default class Footer extends Component {
    render() {
        const {todos} = this.props
        const doneCount = todos.reduce((pre,current)=>{
            return pre+todos.done?1:0
        },0)
        const total=todos.length
        return (
            <div>
                <label>
                    <input>
                    </input>
                </label>
                <span>
                    <span>
                        已完成{doneCount}
                    </span>
                    /全部 {total}
                </span>
                <button></button>
            </div>
        )
    }
}
